import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Button, Modal, Fade, Backdrop } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';
import {StyleSignIn} from './StyleSignIn'
import Http from '../../../http/apiService';

const useStyles = makeStyles((theme) => ({
    paper: {
        position: 'absolute',
        width: 300,
        backgroundColor: theme.palette.background.paper,
        border: '2px solid #000',
        boxShadow: theme.shadows[5],
        padding: theme.spacing(2, 4, 3),
    },
}));


const SignInButton = () => {
    const classes = useStyles();
    const [open, setOpen] = useState(false);
    const [value, setValue] = useState({
        username: '',
        password: '',
    });
    const handleOpen = () => {
        setOpen(true);
    }
    const handleClose = () => {
        setOpen(false);
    };
    const handleSignin = async () => {
        const resp = await Http.getSth()
    }
    const handleOnChage = () => {

    }
    const body = (
        <StyleSignIn className={classes.paper}>
            <form className={classes.root} noValidate autoComplete="off">
                <span>Sign In</span>
                <TextField id="outlined-basic" label="Username" variant="outlined" onChange={handleOnChage} value />
                <TextField id="outlined-basic" label="Password" variant="outlined" onChange={handleOnChage} value />
                <Button className="btn-signin" onClick={handleSignin}>Sign in</Button>
            </form>
        </StyleSignIn>
    );
    return (
        <React.Fragment>
            <Button className="btn-signin" onClick={handleOpen}>Sign in</Button>
            <Modal
                open={open}
                onClose={handleClose}
            >
                <Modal
                    className={classes.modal}
                    open={open}
                    onClose={handleClose}
                    closeAfterTransition
                    BackdropComponent={Backdrop}
                    BackdropProps={{
                        timeout: 500,
                    }}
                >
                    {body}
                </Modal>
            </Modal>
        </React.Fragment>
    );
}

export default SignInButton;
